import React, { useState } from "react";

function LoginPage() {
  const [cnt,setCnt]=useState(0);
  return (
    <div>
      <p>Count : {cnt} </p>
      <button className="btn" onClick={()=>setCnt(cnt+1)}>
        Click ME 
      </button>      
      <button className="btn" onClick={()=>setCnt(0)}>
        Reset
      </button>
    </div>
  );
}

export default LoginPage;
